import styles from "./UiMenu.modele.scss";
export function UiMenu() {
  return (
    <div className={styles.ui_menu}>
      <a className={`${stiles.menu_list} ${styles.news}`}>Новости</a>
      <div className={styles.news_list}>
        <a>Фотографии</a>
        <a>Друзья</a>
      </div>
      <a className={`${stiles.menu_list}`}>Рекомендации</a>
      <a className={`${stiles.menu_list}`}>Поиск</a>
      <div></div>
      <a className={`${stiles.menu_list}`}>Реакции</a>
      <a className={`${stiles.menu_list}`}>Обновления</a>
      <a className={`${stiles.menu_list}`}>Комментарии</a>
    </div>
  );
}
